import React from 'react'
import GridListTitleBar from '@material-ui/core/GridListTileBar'
import {GridListTitle} from '@material-ui/core'

const Header = () => {

    return (
        <div>
            <GridListTitleBar>Hello</GridListTitleBar>
            <GridListTitle>Grid List Title</GridListTitle>
            <h1>Hello This is Header</h1>
            
        </div>
    )
}

export default Header
